import React from "react";
import "./App.css";

export class CurrentTime extends React.Component {
  state = {
    curTime: new Date().toLocaleString(),
  };
  render() {
    return (
      <div className="App">
        <p>Current Time : {this.state.curTime}</p>
      </div>
    );
  }
}
